function Search(props) {
  localStorage.setItem("searchresult", {"id": qwe});
  let searchResults = localStorage.getItem("searchresult");
  return (
    <table style={{'tableLayout': 'fixed', 'width': '100%', 'height': '100%'}}>
      <tbody>
        <tr style={{"height": "66%"}}>
          <td style={{"width": "30%"}}>
            <form>
              <p>THIS WILL BE FORM</p>
            </form>
          </td>
          <td style={{"width": "60%"}}>
            {searchResults.map(elem => (
              <div key={elem.id}>
                THIS ARE SEARCH RESULTS
              </div>
            ))}
          </td>
        </tr>
      </tbody>
    </table>
  );
}

export default Search;
